summary_join, aes(x = average_cals, y = average_heartrate, color = compliance_rate)) +\n","  geom_point() +\n","  labs( x = \"Average Cals\", y = \"Average HR\", color = \"Compliance Rate\") +\n","  scale_color_gradient(low=\"maroon3\", high=\"blue\") +\n","  ggtitle(\"Does Heartrate correlate to Calories Burned METs in our Sample?\") +\n","  theme(plot.title= element_text(hjust = 0.5))"]},{"cell_type":"markdown","id":"c9955017","metadata":{"papermill":{"duration":0.016428,"end_time":"2025-03-19T21:54:30.529657","exception":false,"start_time":"2025-03-19T21:54:30.513229","status":"completed"},"tags":[]},"source":["This visual allows you to see if there is a correlation between heartrate and calories and compliance for the 15 people that tracked both calories and heartrate.  (note the warning from the plotting tool that 1 athlete was not included because they lacked either calorie or heartrate info).  But you are able to see some correlation in increased calories aligning with increased heartrate."]},{"cell_type":"markdown","id":"f86bdc82","metadata":{"papermill":{"duration":0.016341,"end_time":"2025-03-19T21:54:30.56219","exception":false,"start_time":"2025-03-19T21:54:30.545849","status":"completed"},"tags":[]},"source":["## Conclusion and Recommendation\n","It may be surprising to see only a third of fitbit users are actually making the exercise targets deemed necessary to live a healthy lifestyle by the American Heart Association.  I would consider fitbit users more conscious of the need for movement so the number could actually be lower across the non-fitbit population.\n","\n","I believe it would be most beneficial to understand why people are not meeting guidelines (both fitbit users and general population).   Is it lack of motivation, perceived barriers, insufficient knowledge?  Polling people to understand what's holding them back despite AHA guidelines could identify key marketing messages for tracking exercise.    \n","\n","Some ideas on roadblocks - \n"," - do non-fitbit users know how much exercise they're currently getting to even determine how they do against ADA targets?   BellaBeat tools are a great way to start!\n"," - do people feel it's too hard to meet targets?  Does BellaBeat need to communicate the AHA targets aim to improve well-being and aren't about elite fitness?\n"," - can BellaBeat leverage the scientific studies completed by the ADA to point out the value of healthy longevity?\n"," \n"," - can BellaBeat show, using their tools, a real return on investment between working toward ADA targets the athlete's metrics of improved sleep, increased energy, weight loss.\n"," \n"," \n","Polling needs to be completed to identify roadblocks for people.   \n","A/B tests need to be conducted to see how different messages for handling of these roadblocks, as well as incentives, are received by potential customers.  \n","\n","By shifting the focus from intense fitness to accessible well-being, addressing perceived barriers, and providing targeted support, BellaBeat can reach the majority of users who are not currently meeting ADA guidelines as a target audience for their offerings."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":7746251,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":388.649165,"end_time":"2025-03-19T21:54:31.000843","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2025-03-19T21:48:02.351678","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}